import { apiGetNewsDetailsList } from '@/api/News.js'
import back from "@/components/Botton/back.vue";
    export default{
           components: {
                back
            },
    data() {
        return{
            list: [{
                Title: '',
                Content: ''
            }],
            Id: '',
        }
    },
    methods: {
        goBack() {
            this.$router.go(-1);
        }
    },
    created() {
        this.Id = this.$route.params.id;
        let data = {
            newsTypeId: 1,
            id: this.Id,
            index: 1,
            count: 10
        }
        apiGetNewsDetailsList(data, true).then(res =>{
            this.list = res
        })
    }
}
